import React, {Component} from 'react';

class EventPage extends Component {

  constructor(props){
    super(props)
    this.state = {latitude:props.latitude,
                  longitude:props.longitude,
                  events:props.events}
  }

  render(){
    return <h1> test event page </h1>;
  }
}

export default EventPage;
